C.yA=new L.y("Sidebar belongs to the body",null,null,null,null,null,null,null,null)
C.Wt=new L.y("This is not very useful feature as such, but a nice looking and rather interesting stress test for Flutter, especially for Web builds.\n\nWe could make the grid of switching images infinite, but this demo stops at 500 images in the grid.\n",null,null,null,null,null,null,null,null)
